import React from "react";

function Footer() {
	return (
		<div style={styles.header}>Created by: Carloooos, Elizaveta, Kevin</div>
	);
}

export default Footer;

const styles = {
	header: {
		display: "block",
		float: "top",
		background: "#00193d",
		padding: "0",
		height: "160px",
	},
};
